import React from "react";
import "./Footer.css";

const Footer = () => (
  <footer className="footer">
    <p>&copy; 2025 Wobb. All rights reserved.</p>
    <nav>
      <a href="#">Terms</a>
      <a href="#">Privacy</a>
      <a href="#">Contact</a>
    </nav>
  </footer>
);

export default Footer;
